import {Switch, Route} from 'react'
import DetailedVideoContent from './DetailedVideoContent'


// "file_name" : "",

const redirectPage = () => {
  /*
  <Switch>
    <Route exact path='/' component={DetailedVideoContent}></Route>
  </Switch>
  */
  console.log("clicked")
}

const Video = (props) => {
    const video_url  = props.video_url;

    return (
      <div className="videoContent">
        <div>
          <video width="558" height="290" controls>
            <source type="video/mp4" src={video_url}></source>
          </video>
        </div>
      
        <div>
          <button id='view-VideoDetails' onClick={redirectPage.bind(this)}>View Details</button>  
        </div>  
      </div>
    )
}

export default Video

